CREATE TABLE performance(
   trip_id            INTEGER  NOT NULL PRIMARY KEY 
  ,device_id          INTEGER  NOT NULL
  ,date               DATE  NOT NULL
  ,start_time         TIME  NOT NULL
  ,end_time           TIME  NOT NULL
  ,start_terminal     VARCHAR(6) NOT NULL
  ,end_terminal       VARCHAR(6) NOT NULL
  ,travel_time        NUMERIC(18,2) NOT NULL
  ,dwell_time         NUMERIC(18,2) NOT NULL
  ,SITR               NUMERIC(18,13) NOT NULL
  ,day_of_week        INTEGER  NOT NULL
  ,day_name           VARCHAR(9) NOT NULL
  ,hour_of_day        NUMERIC(5,2) NOT NULL
  ,weekend            BIT  NOT NULL
  ,rush_hour          BIT  NOT NULL
  ,excess_travel_time NUMERIC(19,2) NOT NULL
  ,Direction          VARCHAR(12) NOT NULL
  ,anomaly_score      INTEGER  NOT NULL
  ,behaviour          VARCHAR(7) NOT NULL
  ,cluster            INTEGER  NOT NULL
);
